class Noun {
  constructor(word, declension, genders, usage_notes, definition) {
    this.type = "n"
    this.word = word
    this.definition = definition 
    this.declension = declension
    this.genders = genders
    this.usage_notes = usage_notes
  }
}

class Verb {
  constructor(word, definition , forms, usage_notes) {
    this.type = "v"
    this.word = word
    this.definition = definition 
    this.forms = forms
    this.usage_notes = usage_notes
  }
}

class Adjective {
  constructor(word, declesion, defenition, forms, usage_notes) {
    this.type = "adj"
    this.word = word
    this.declesion = declesion
    this.definition = definition 
    this.forms = forms
    this.usage_notes = usage_notes
  }
}

class Adverb {
  constructor(word, definition , forms, usage_notes) {
    this.type = "adv"
    this.word = word
    this.definition = definition 
    this.forms = forms
    this.usage_notes = usage_notes
  }
}

class Auxiliary {
  constructor(word, definition , forms, usage_notes) {
    this.type = "aux"
    this.word = word
    this.definition = definition 
    this.forms = forms
    this.usage_notes = usage_notes
  }
}

class Preposition {
  constructor(word, definition , usage_notes) {
    this.type = "pp"
    this.word = word
    this.definition = definition 
    this.usage_notes = usage_notes
  }
}

class Particle {
  constructor(word, definition , usage_notes) {
    this.type = "part"
    this.word = word
    this.definition = definition 
    this.usage_notes = usage_notes
  }
}

class Determiner {
  constructor(word, definition , usage_notes) {
    this.type = "det"
    this.word = word
    this.definition = definition 
    this.usage_notes = usage_notes
  }
}

class Conjunction {
  constructor(word, definition , usage_notes) {
    this.type = "con"
    this.word = word
    this.definition = definition 
    this.usage_notes = usage_notes
  }
}


